import React, { Fragment } from "react";
import { MDBBtn } from "mdbreact";

const ButtonInicio = () => {


  return (
    <Fragment>
        <div className="text-non-decoration">
      <MDBBtn outline color="none">GALERIA</MDBBtn>
      <MDBBtn outline color="none">CONTACTO</MDBBtn>
      </div>
    </Fragment>
  );
}

export default ButtonInicio;
